Stardust 5 (1997)

Honey Potts, Pepper, Bubba and Poe are here in Hollywood, and Phoenix films will never be the same! Whether it's a blowjob in the back of a limo, a desktop balling in front of a shocked screenwriter, or a scorching bubble bath in a Beverly Hills hotel, these rubes are puttin the jizz back in showbiz! It's Part 5 of Michael Zen's epic serial Stardust, the series AVN called &quot;one of the wildest, sexiest, erotically potent forays we've seen in sometime.&quot; Rent it and stay tuned for Part 6...when UFO's buzz the Pott's home, putting our stars in a truly spaced out epiphany!!!

Pornstars, Blondes, Big Tits, Group Sex

